import React from 'react'

import '/Users/nikitamandlik/Desktop/weather-app/weather-app/src/index.css'
function ShowWeather({data}){
    const city = data.name;
    const country = data.sys? data.country:null;
    const temp = data.main?data.main.temp:null;
    const pressure = data.main?data.main.pressure:null;
    const visibility = data? data.visibility:null;
    const humidity = data.maindata.main.humidity
    const clouds = data.clouds
    return(
        <div>
            <div>
                <h1>
                   {city}<br/><span>{country}</span> 
                </h1>
                <h3>Temperature : {temp}</h3>
                <hr/>
                <div>
                    <p>
                        Pressure<br/>{pressure}
                    </p>
                    <p>
                        Visibility <br/> {visibility}
                    </p>

                </div>
                <div>
                    <p>
                        Humidity : <br/> {humidity}
                    </p>
                    <p>
                        Clouds : <br/> {clouds}
                    </p>
                </div>
            </div>
        </div>
    )
}
export default ShowWeather;
